import React from 'react';
import './App.css';
import Checkout from '../Checkout/Checkout';
import NavBar from '../NavBar/NavBar';

const App = () => {
	return (
		<div className = 'main-container'>
			<div className = 'top-banner'>
			<h>Welcome User6969</h>
			</div>
			<NavBar/>
			<Checkout/>
		</div>
	);

}

export default App;
